import React from 'react';
import ReactDOM from 'react-dom';
import Card from "./Card";
import "./index.css";
import sdata from "./sdata";

const oldarr = ['rahul','sagar','vipul','bhushan'];
const newarr = oldarr.map(function (cvalue) {
  return cvalue+" " ;
} );


ReactDOM.render(
  <>
  <h1 className="heading_style">List of top 5 songs in 2020 {newarr}</h1>
  <Card 
  imgsrc =  {sdata[0].imgSrc}
  title  =  {sdata[0].title}  
  sname  =  {sdata[0].sname}  
  link   =  {sdata[0].link}  />

  <Card 
  imgsrc =  {sdata[1].imgSrc}
  title  =  {sdata[1].title}  
  sname  =  {sdata[1].sname}  
  link   =  {sdata[1].link}  />

  <Card 
  imgsrc =  {sdata[2].imgSrc}
  title  =  {sdata[2].title}  
  sname  =  {sdata[2].sname}  
  link   =  {sdata[2].link}  />

  <Card 
  imgsrc =  {sdata[3].imgSrc}
  title  =  {sdata[3].title}  
  sname  =  {sdata[3].sname}  
  link   =  {sdata[3].link}  />

  <Card 
  imgsrc =  {sdata[4].imgSrc}
  title  =  {sdata[4].title}  
  sname  =  {sdata[4].sname}  
  link   =  {sdata[4].link}  />



  </>
  ,document.getElementById('root')
);
